import { Card, CardContent, Grid } from "@mui/material";
import React from "react";
import { Form } from "./Form";

export const Home = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={12}>
        <img
          src="https://images.unsplash.com/photo-1611072965169-e1534f6f300c?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8NjN8fHBoYXJtYWN5fGVufDB8fDB8fHww"
          height={500}
          width="100%"
          alt=""
        />
        <Grid container spacing={2}>
          {/* <Grid item xs={2}></Grid> */}
          <Grid item xs={12}>
            <Form />
          </Grid>
          {/* <Grid item xs={2}></Grid> */}
        </Grid>
      </Grid>
    </Grid>
  );
};
